import React from 'react';

const Art = (props) => {
    return (
        <>

        <div className="col-md-3 col-6 ">
            <figure className="gal_img">
            <img className="img-fluid" src={props.img} alt="image" >
        </img>
            </figure>
        </div>
       
        




        </>
    )
}

export default Art
